import './App.css';
import currentTime from './helpers/ClockFunction';
import { useEffect } from 'react';
import Clock from './components/Clock';

function App() {

  useEffect(() => {
    currentTime();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>All in pocket</h1>
        <Clock />
      </header>
    </div>
  );
}

export default App;
